import React from 'react';

class Navigation extends React.Component {
    constructor() {
        super();
        this.state = {

        }
    }

    render() {
        return (
            <div className="navigation">
                <div className="container">
                    <div className="inside">
                        <div className="nav nav-tab menu">
                            <a href="#settings" data-toggle="tab" title="User Setting" className="">
                                <i class="ti-panel"></i>
                                Setting
                            </a>
                            <a href="#members" data-toggle="tab" title="All members" class="active show">
                                <i class="ti-home active"></i>
                                All Friends
                            </a>
                            <a href="#discussions" data-toggle="tab" class="" title="Chat">
                                <i class="ti-comment-alt"></i>
                                Recent Chat
                            </a>
                            <a href="#notifications" data-toggle="tab" class="f-grow1" title="Notifications">
                                <i class="ti-bell"></i>
                                Notifications
                            </a>
                            <a href="#notifications" data-toggle="tab" class="f-grow1" title="Notifications">
                                <svg name="Search" aria-hidden="false" width="30" height="30" viewBox="0 0 18 18"><g fill="none" fill-rule="evenodd" aria-hidden="true"><path fill="currentColor" d="M3.60091481,7.20297313 C3.60091481,5.20983419 5.20983419,3.60091481 7.20297313,3.60091481 C9.19611206,3.60091481 10.8050314,5.20983419 10.8050314,7.20297313 C10.8050314,9.19611206 9.19611206,10.8050314 7.20297313,10.8050314 C5.20983419,10.8050314 3.60091481,9.19611206 3.60091481,7.20297313 Z M12.0057176,10.8050314 L11.3733562,10.8050314 L11.1492281,10.5889079 C11.9336764,9.67638651 12.4059463,8.49170955 12.4059463,7.20297313 C12.4059463,4.32933105 10.0766152,2 7.20297313,2 C4.32933105,2 2,4.32933105 2,7.20297313 C2,10.0766152 4.32933105,12.4059463 7.20297313,12.4059463 C8.49170955,12.4059463 9.67638651,11.9336764 10.5889079,11.1492281 L10.8050314,11.3733562 L10.8050314,12.0057176 L14.8073185,16 L16,14.8073185 L12.2102538,11.0099776 L12.0057176,10.8050314 Z"></path></g></svg>
                            </a>

                            <a href="#sign-in.html" class="btn power" title="Sign Out"><i class="ti-power-off"></i></a>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default Navigation;
